window.bookSummaryJSON = "<p>Michael continues to work to fulfill the promise to his love, but the world isn't the same place.</p> <p>Now, there is a mistake he made centuries in the past walking around he needs to rectify.</p> <p>To complicate matters, there is a group out of England believing Michael's blood will be just what they need for their business. While they get nasty Vampires off the street at the same time.</p> <p>Further, the effort to pull together the Sacred Clan's ship parts are starting to come together.</p> <p>Unfortunately, no one wishes to give Michael and his new family any help.</p> <p>What is a man with a hair problem supposed to do?</p> <p>Michael has his own brand of justice, and this world now understands the Patriarch is back.</p> <p>Nothing will be the same.</p>"; 
